        </Modal.Footer>
      </Modal>
      <Modal show={showPlace} onHide={tooglePlace}>
        <Modal.Header closeButton>
          <Modal.Title>New Haven, CT</Modal.Title>
        </Modal.Header>
        <Modal.Body>
          <img src="https://www.nps.gov/common/uploads/grid_builder/imr/crop16_9/CACF8A0C-1DD8-B71B-0B8F8F8F8F8F8F8F8.jpg?width=950&quality=90&mode=crop" alt="airplane" />
        </Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={tooglePlace}>
            Close
          </Button>
        </Modal.Footer>
      </Modal>
      <Modal show={showPlace2} onHide={tooglePlace2}>
        <Modal.Header closeButton>
          <Modal.Title>Manhattan, NY</Modal.Title>
        </Modal.Header>
        <Modal.Body>
          <img src="https://www.nps.gov/common/uploads/grid_builder/imr/crop16_9/CACF8A0C-1DD8-B71B-0B8F8F8F8F8F8F8F8.jpg?width=950&quality=90&mode=crop" alt="airplane" />
        </Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={tooglePlace2}>
            Close
          </Button>
        </Modal.Footer>
      </Modal>


    </>
